import React from "react";
import Navbar from "./Navbar";

function Blog() {
  return (
    <div className="max-w-[1400px] h-auto mx-auto">
      <Navbar />
      <div className="">
        <h1 className="text-white text-2xl">Keto diet for sugar patients</h1>
      </div>
    </div>
  );
}

export default Blog;
